import React from 'react';
import autoMergeLevel1 from 'redux-persist/es/stateReconciler/autoMergeLevel1';


//without header 
const LandingPage = () => {


  return(
            <div id="main">
                    <div id="box1"></div>

                    <div id="box2">
                        <div id="text">
                            NEXUSARK
                        </div>
                    </div>
                    <div id="box3"> 
                       <div id="container">
                            <div id="logo">
                                  <img style={{height: 200, width: 100, display: "flex"}} src="/pic.png" />
                            </div>  
                       </div>
                    </div>
              </div>
  )
};





export default LandingPage;
